type: object
description: 'Different filter used to filter the userbm result list'
properties:
  filterColumn:
    type: string
  filterValue:
    type: string
  filterOperator:
    type: string
    enum:
      - EQUAL
      - LIKE
      - GREATER THAN
      - GREATER OR EQUAL
      - LOWER THAN
      - LOWER OR EQUAL
      - BETWEEN
    example: EQUAL
  
